import React from 'react';
import { useParams } from 'react-router-dom';

function Chatbot() {
  const { mysource } = useParams();

  // Use the `mysource` parameter to determine which chatbot to display
  // You can modify your code accordingly here

  // Update the URLs to include the `mysource` parameter
  const publicChatbotUrl = `/OAD?mysource=${mysource}`;
  const internalChatbotUrl = `/OAD?mysource=${mysource}`;

  return (
    <div>
      {/* Render the chatbot based on the `mysource` parameter */}
      <iframe src={mysource === 'public' ? publicChatbotUrl : internalChatbotUrl} />
    </div>
  );
}

export default Chatbot;
